import React from 'react';
import Display from './Display';
import Options from './Options';

class Main extends React.Component{
constructor(props){
    super(props);
    this.state={
        name: 'Rhea'
    }
}


render(){
    return(
        <div>
            <Display />
            <Options />
        </div>
    )}

}



export default Main;
